import styled from '@emotion/styled';

export const Container = styled.div`
  height: 100vh;
  position: fixed;
  .pro-sidebar,
  .pro-sidebar-layout,
  .pro-sidebar-inner {
    color: #000;
    background-color: #f5f5f0;
    z-index: 0;
  }
`;
